import Button from "react-bootstrap/Button";
import "bootstrap/dist/css/bootstrap.min.css";

const Header = () => {
  return (
    <header>
        <h1>RTTM</h1>
        <Button>Home</Button>
        <Button>Technologies</Button>
        <Button>Sign in/ Sign Up</Button>
    </header>
  )
}

export default Header
